import React from "react";

const CancelPayment = () => {
  const styles = {
    container: {
      display: "flex",
      flexDirection: "column",
      alignItems: "center",
      justifyContent: "center",
      height: "100vh",
      backgroundColor: "#f8f9fa",
      textAlign: "center",
    },
    message: {
      fontSize: "2rem",
      color: "#dc3545",
      marginBottom: "20px",
    },
  };
  return <h1>You have cancelled your payment.</h1>;
};

export default CancelPayment;
